const initialState = {
    name1: "",
    name2: ""
};


export const generateSetName1ActionWithName = name => ({
    type: "ADD_NAME_1",
    name
});

export const generateSetName2ActionWithName = name => ({
    type: "ADD_NAME_2",
    name
});


const reducer = (state = initialState, action={type:"UNKNOWN"}) => {
    switch (action.type) {
        case "ADD_NAME_1":
            return {
                ...state,
                name1: action.name
            };
        case "ADD_NAME_2":
            return {
                ...state,
                name2: action.name
            };
        case "CLEAR_NAMES":
            return  {
                ...state,
            };
        default:
            return state;
    }
};

export default reducer;
